  true,\n\t\"url\": null,\n\t\"notes\": \"nNCEP/NCAR Arctic Marine Rawinsonde Archive,
  available via ftp,ncontains 17,659 marine rawinsonde reports for the region north
  of 65ndegrees North. Its record extends from 1976 to 1996. These soundingsnhave
  been extracted from the National Center for Atmospheric Researchn(NCAR) rawinsonde
  archive of the National Meteorological Center (NMC)n(now the National Center for
  Environmental Prediction, or NCEP). ThenNCEP/NCAR Arctic Marine Rawinsonde Archive
  data set complements thenHistorical Arctic Rawinsonde Archive (HARA) for land stations
  and thenRussian 'North Pole' drifting station archive.n\",\n\t\"license_title\":
